('39.9705000000', '-86.0910800000', 'tradamerican', 1281, '12552 Gray Rd', '+14632732004', 'Roots Burger Bar', '3.5', 31, 'peZev4lUJxPZEJpvx0R-DA', ' who knew such a place could exist in a strip mall my boyfriend and i came on a saturday and this place was busy upon walking in we immediately loved the when this place first opened my husband and i loved it staff were great and the burgers as well as the fish and chips last night we went and the service good evening scott long time patron of you last venture and many of its locations first and second time visiting a roots burger bar i was in this', 'https://s3-media3.fl.yelpcdn.com/bphoto/zBeZwJSHAXCNrgxK06oMdQ/o.jpg', 'https://www.yelp.com/biz/roots-burger-bar-carmel?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', ''),
('40.1978030000', '-85.4058260000', 'burgers', 1282, '1700 West University Ave', '+17652166026', 'Roots Burger Bar', '4.0', 105, 'ErT_xL01WXdvU8OZAVLFLg', ' always a good time when we go to roots my husband loves that they give popcorn to all the tables and their burgers are very good always have the sports on dropped in on a recent visit to the area and was looking for a bite  we found this place on yelp and tried it based on the reviews  parking is tight took so first off- this was a grubhub delivery so full disclosure but the location is 2 miles away the burgers were fine enough nothing crazy good the', 'https://s3-media3.fl.yelpcdn.com/bphoto/5QkWdzWavXi1-p8bDLutLQ/o.jpg', 'https://www.yelp.com/biz/roots-burger-bar-muncie?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7575653114', '-86.1457939620', 'newamerican', 1283, '653 Virginia Ave', '+13176861580', 'Bluebeard', '4.5', 1123, 'WrZaL6BxHqVqt3sAcJ-5Rg', ' this place is highly rated so we decided to check it out had to wait awhile before sitting at the bar pork belly and octopus immediately caught my eye my wife and i went here on the last day of devour 2023 she went with the devour menu getting the beet salad vegetarian pasta dish and the bread pudding i we had a nice experience at bluebeard but im not sure well be back for dinner for some time i visited with a group of 5 for a work anniversary', 'https://s3-media3.fl.yelpcdn.com/bphoto/vWGojajKespEkRsYvgFjxw/o.jpg', 'https://www.yelp.com/biz/bluebeard-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.8715514828', '-86.1431678661', 'shoes', 1284, '6350 Guilford Ave', '+13172533709', 'Good Earth Natural Food', '4.5', 91, '926L7Go0lOMk_GyXSjMc8Q', ' i followed my friend around good earth like a puppy with my mouth agape shes a seasoned veteran and nonchalantly showed me room after room of foods this place has all the good healthy good stuff theyve got everything from herbs powders and supplements i purchase bladderwrack burdock root sea the staff is very helpful and good earth always has a great selection of herbs im looking for  a great place to get specialty herbs without the wait  i', 'https://s3-media2.fl.yelpcdn.com/bphoto/PghGVlQ2GMSs8NZJyOHWLQ/o.jpg', 'https://www.yelp.com/biz/good-earth-natural-food-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7218481556', '-86.0895283520', 'tea', 1285, '626 Main St', '+13175919497', 'Rustic Root', '4.5', 39, '1ySb0EDc_DEiFwcyYbIdXA', ' if you are looking for a place to have a special outing with your girl friends i would highly recommend the rustic root when you enter the establishment the cutest great atmosphere and well thought out tea service the grand tea is plenty to drink and eat if 2 people opt for 2 grand teas they combine it i saw a recommendation for the tea room and decided to try it out with a friend we meet regularly for lunch and love new placeswe did not have', 'https://s3-media2.fl.yelpcdn.com/bphoto/GZo249YSHiKOgoy2P6rPuQ/o.jpg', 'https://www.yelp.com/biz/rustic-root-beech-grove-4?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7717500000', '-86.1540200000', 'tradamerican', 1287, '310 Massachusetts Ave', '+13179291799', 'The Eagle', '4.5', 2571, 'UFCN0bYdHroPKu6KV5CJqg', ' im vegetarian but i still love this place for its mac and cheese enough said  its the creamiest bowl of heavenly goodness with just the right amount of death is a peculiar thing as it marks the end of life but also presents the possibility of rebirth in my own writing i have often mused on the subject my partner and i came around 515 on a friday night put our names on the waitlist and took a seat at the bar to grab a drink seating was a little', 'https://s3-media1.fl.yelpcdn.com/bphoto/Mja3-Ql35_nTNCeimreOXA/o.jpg', 'https://www.yelp.com/biz/the-eagle-indianapolis-13?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7719812000', '-86.1535945000', 'bars', 1288, '334 Massachusetts Ave', '+13176356962', 'Bakersfield', '4.5', 1790, 'S_jfDqc2TUhkraTpeZgqjg', ' love bakersfield playlists and dip trio but haelis service today was out of this world so attentive and kind even tolerated our silly questions about love bakersfield the queso and guacamole are to die for the margaritas are also amazing my wife and i go here often when we want dinner outside of the house fun atmosphere great food awesome drinks and the best service around ask for', 'https://s3-media2.fl.yelpcdn.com/bphoto/AFRmyeh5hpVhdZ-4gD6aDg/o.jpg', 'https://www.yelp.com/biz/bakersfield-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$');
