('39.7721510000', '-86.1538340000', 'tradamerican', 1289, '323 N Delaware St', '+13177466097', 'The Oakmont', '4.5', 296, 'f2kxNoOEdL3bAi_p2UrWxw', ' my first time and it was great tried to make reservations at the last minute but there were none we were able to walk up and get seats at the bar the this was our third visit to oakmont and we have been delighted every time oakmont is a beautiful establishment that is often crowded however if you make great pregame or late night spot on mass i went for late night drinks and a quick bite this place was slower at night during the week but it gets super', 'https://s3-media3.fl.yelpcdn.com/bphoto/8qbwXGsRP-DvPN9x-laxcw/o.jpg', 'https://www.yelp.com/biz/the-oakmont-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7732276917', '-86.1511688232', 'jazzandblues', 1293, '435 Massachusetts Ave', '+13176360584', 'Chatterbox Jazz Club', '4.0', 159, 'GcB6ydlPej7iFqkGVK0ZRA', ' i love chatterbox great music mostly jazz but not only by incredibly talented mostly local artists wide variety of drink options live that they have i love chatterbox im so glad they came back  their commitment to live jazz and their drink options are top notch it definitely has a grunge vibe but if great venue  totally a tiny dive bar with great service and great live music every day  there is a small cover charge  full bar  tap beer  frozen', 'https://s3-media2.fl.yelpcdn.com/bphoto/skKQS4xUDlp3hDgzuInLKQ/o.jpg', 'https://www.yelp.com/biz/chatterbox-jazz-club-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$'),
('39.7524736889', '-86.1387534821', 'lounges', 1294, '1116 Prospect St', '+13176869550', 'White Rabbit Cabaret', '4.5', 118, 'wx_s6Vkpm3fgB0een8Fhcg', ' so thrilled to have found this place an advertisement for their brain drain trivia night brought us in and we were very pleasantly surprised definitely white rabbit always has fun interesting shows and events having for a good pricei especially love their comedy shows on friday nights the bar is this place is an absolute gem its located right in fountain square and we went there this monday to watch a cabaret comedy show featuring lillian baxter', 'https://s3-media3.fl.yelpcdn.com/bphoto/ZtRLQOqfURj-VOzLYR1kxA/o.jpg', 'https://www.yelp.com/biz/white-rabbit-cabaret-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7526910000', '-86.1409750000', 'musicvenues', 1295, '1043 Virginia Ave', '+13179867100', 'HI-FI', '4.5', 133, 'cSHp3ncOeVuIRNHqxf-7kQ', ' excellent location for indie band concertsrecently i attended a toadies show at the hi-fi annex an outdoor setup in the back of the murphy art center in chill intimate venue with both an indoor and outdoor concert space  they have reasonably priced shows most nights of the week  i didnt have any but the my favorite concert venue in indy great lineup with artists big and small great layout so everyone has a good view of the stage tickets are almost', 'https://s3-media2.fl.yelpcdn.com/bphoto/7EVzdowUQRGDp9tOGSuvNQ/o.jpg', 'https://www.yelp.com/biz/hi-fi-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7523675833', '-86.1390688312', 'musicvenues', 1296, '1119 E Prospect St', '+13179550995', 'Radio Radio', '4.5', 54, 'WnZhGc722cszK_5imM4Qsw', ' indianapolis has several really cool venues for live music and a few crap ones i have a soft place in my heart for tufty cloughs radio radio a fountain radio radio has always been a fantastic place to see live shows in indianapolis they support local music but they bring in touring acts as well my radio radio has always been rad but the recent upgrade to the sound system has made it one of my favorite places in indy to see live music  theyve also', 'https://s3-media2.fl.yelpcdn.com/bphoto/ukEGLxcFbnRaSMcqPAgcLQ/o.jpg', 'https://www.yelp.com/biz/radio-radio-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7643600000', '-86.1575400000', 'bars', 1297, '20 E Georgia St', '+13179550300', 'Howl at the Moon Indianapolis', '3.0', 175, 'ElaSvDEnNV0yfKkKzczLbw', ' went to howl at the moon for a birthday and the atmosphere was perfect however what really made the night great was our server kharonda she was amazing we came here for their new years eve event it was a ticketed event with different tiers we bought the base tier which include admission open bar and a in september 2021 i celebrated my three-month double transplant anniversary i decided to celebrate this milestone with friends and family after winning a', 'https://s3-media3.fl.yelpcdn.com/bphoto/Jxvke4k6Q54Hk3RZEHaYFw/o.jpg', 'https://www.yelp.com/biz/howl-at-the-moon-indianapolis-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7811986173', '-86.1696830597', 'bbq', 1299, '621 West 11th St', '+13173336234', 'City Barbeque', '4.0', 240, 'O2cLeZe_YMPVnThflDX9Zg', ' my coworkers and i went to celebrate a birthday ended up with the motherload brisket pulled pork turkey half slab of ribs a half chicken two my wife and i live in ames iowa but we visit west lafayette for a week or so every month to visit our daughter sil and granddaughter i ordered city bbq city barbeque is one of my favorite places  the food is consistently good and the service is friendly  i have tried most of the items on the menu and most', 'https://s3-media3.fl.yelpcdn.com/bphoto/PLOcpKFpnz6LqgXGy9l6xQ/o.jpg', 'https://www.yelp.com/biz/city-barbeque-indianapolis-4?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7714614868', '-86.2052841187', 'localflavor', 1300, 'Indianapolis, IN 46222', '', 'City of Indianapolis', '4.5', 15, 'ioHnS9WgL3Cm0saFP-4lkg', ' for all the bad press this city seems to get i want to weigh in on the positives over my 5 days in february a long overdue this review focuses on downtown i was born in lebanon indiana with spina bifida a birth defect that when i was born still led to death for about 95 of those babies born with it while this is what i would call a little big city it is however the largest major us city thats not located on a navigable river it is indianas capitol', 'https://s3-media4.fl.yelpcdn.com/bphoto/I5kD8-hqnT-iGxpUPWC4Ug/o.jpg', 'https://www.yelp.com/biz/city-of-indianapolis-indianapolis-2?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', ''),
('39.8246400000', '-86.1559200000', 'burgers', 1301, '23 E 38th St', '+13172837000', 'Big City Grill & Lemonade', '4.5', 123, '0BgrDm4tfQBtlEV-ZqtAtg', ' my first time eating here it was easy to find and some off street parking is available  carry out business was brisk but a few parking spots were still loved big city the food was prepared quickly and more importantly was delicious sam was very helpful and gave great recommendations for us and for our i absolutely love this place carry out or delivery its always fast and fresh wings are cooked perfectly seasoned well with a nice crunch seasoned', 'https://s3-media1.fl.yelpcdn.com/bphoto/-bZzMn5jVVg9MgTdzuy55A/o.jpg', 'https://www.yelp.com/biz/big-city-grill-and-lemonade-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$'),
('39.7878401417', '-86.1533707294', 'galleries', 1302, '1505 N Delaware St', '+13173966386', 'City Gallery', '5.0', 1, 'UU86gyil8a4GzZSRpGiccQ', ' i absolutely love city gallery a small space that packs a punch have seen some wonderful shows here and love the connection usually shown to urban', 'https://s3-media3.fl.yelpcdn.com/bphoto/Nx9Gsk_D7oFIrDf0pqaB-g/o.jpg', 'https://www.yelp.com/biz/city-gallery-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', ''),
('39.9793760000', '-86.0016920000', 'bbq', 1303, '9367 Ambleside Dr', '+13173483448', 'City Barbeque', '4.0', 213, 'yN6jZyG1G1FG_HCZQlJZ1g', ' we had the best ribs service was excellent leftovers the next day -- also amazing well be back city barbecue is tricky    ive eaten here a handful of times and heres my final opinion  carmel and fishers locations    -the customer service is we ordered the sampler the judge sampler everything was great my husband ate it for three days the pulled pork was very tender not stringy but tender', 'https://s3-media3.fl.yelpcdn.com/bphoto/QITuMq0vtW04UGPMB5cMWQ/o.jpg', 'https://www.yelp.com/biz/city-barbeque-fishers?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.7687900000', '-86.1534900000', 'chinese', 1304, '222 E Market St', '', 'City Wok', '2.5', 3, 'aKioWu22vFYhkXUkf0Uu1g', ' city wok is a food court chinese food establishment located inside downtown indianapolis circle centre mall my family and i were in town for my daughters i really enjoyed it it honestly doesnt look that appetizing as you approach it but i implore you to try the rice and orange chicken they were about as i hate to be that guy but i have to be brutally honest  this place is lacking in several departmentsthe food quality is horrible  the rice is dry and', 'https://s3-media3.fl.yelpcdn.com/bphoto/jBy6Pafeelhh06cDvOxy_g/o.jpg', 'https://www.yelp.com/biz/city-wok-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', ''),
('39.9591110000', '-86.1268184000', 'bbq', 1305, '1356 South Rangeline Rd', '+13176608369', 'City Barbeque', '4.0', 257, 'rQMNZj4GB08s_22JsLwTYw', ' so last time i was at this location several years ago before covid the service was beyond terriblei stopped by this afternoon and had to comment as i i decided i was in the mood for city bbq for dinner tonight because i have always enjoyed the food from city bbq  as always it did not disappoint me at excellent food   jennifer greeted us with an offer to sample anything we wanted  she was upbeat and pleasant   food was prepared quickly and did not', 'https://s3-media1.fl.yelpcdn.com/bphoto/2gapMKl3FwXe0M54KN0hzw/o.jpg', 'https://www.yelp.com/biz/city-barbeque-carmel?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$$'),
('39.8281400000', '-86.1154600000', 'churches', 1306, '3908 Meadows Dr', '+13179695448', 'City of Lights Church', '5.0', 2, 'GHWDV7PUxjnRZc0qGVz8Fg', ' incredible church on indys east side setting up in a local ymca city of lights has a great energy about it you just want to be a part of this group i love being a part of this beautiful community everyone is super warm and encouraging and i always leave feeling inspired', 'https://s3-media2.fl.yelpcdn.com/bphoto/74E1c3bM1GZdqmWkrxMXyg/o.jpg', 'https://www.yelp.com/biz/city-of-lights-church-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', ''),
('39.7677200000', '-86.1535300000', 'localflavor', 1307, '200 E Washington St', '+13173273200', 'City of Indianapolis Marion County', '3.5', 8, 'WaoVnzCaqGuj09YCOGUaeA', ' is the city-county building itself a bit dated yes it was built in the 60s and thats not going to change but it is a centrally located easily it looks very forboding but in reality its very easy to get in and out   my review might be a little higher than others because i dont have to go this review is on the building itself as i believe a review for each individual office and the staff  should be represented separately  first of all if', 'https://s3-media1.fl.yelpcdn.com/bphoto/A5zZxavtGUHidD_0-lHfEA/o.jpg', 'https://www.yelp.com/biz/city-of-indianapolis-marion-county-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', ''),
('39.7686835000', '-86.1534500000', 'localflavor', 1308, '222 E Market St', '+13176349266', 'Indianapolis City Market', '4.0', 240, 'uvGfk8eirExWR-B9zsIN5Q', ' since i started a new job in downtown indy i have been in search of my new go-to lunch spot and bam i found it for whatever reason i had never had a i went to city market for lunch and got food at a middle eastern restaurant and dessert at a cookie stand the falafel wrap and fries i got from the middle this place needs a facelift and an energizer of some sort    it was dead on a beautful sunny saturday afternoon   it has a lot of potential  i hate when', 'https://s3-media3.fl.yelpcdn.com/bphoto/iFqQFvCYlsFYm4p0Q6ttww/o.jpg', 'https://www.yelp.com/biz/indianapolis-city-market-indianapolis?adjust_creative=13fm2IFOwwkkm0xoP1hczw&utm_campaign=yelp_api_v3&utm_medium=api_v3_business_search&utm_source=13fm2IFOwwkkm0xoP1hczw', '$'),
