('39.7756130195', '-86.0447022421', 'bars', 1601, '7150 E Washington St', '+13173579932', 'Blue Moon Bar & Grille', '4.0', 6, 'v4Q2qgO1YuKuMgM7aWh7lA', ' a little hole in the wall bar that you will be happy you stopped at service and drinks are great clean and welcoming atmosphere if you blink you may miss this placeits located right next to the jiffy lube near where eastgate mall was located back in the dayalthough it is a hole i try to like this place but its just not very welcoming unless you know the people already there  i like it when i can go into a dive bar and strike up a', 'https://s3-media1.fl.yelpcdn.com/bphoto/QcLqcuGG4cDVIx1FRpAx1A/o.jpg', 'https://www.yelp.com/biz/blue-moon-bar-and-grille-indianapolis', '$'),
('39.7439200000', '-86.1492400000', 'bars', 1603, '1729 S East St', '+13176344072', 'Bowhaus Tap', '5.0', 13, 'TD4xjyZUzAtR_W_hL-48PQ', ' awesome neighborhood bar good service and fantastic prices cool aesthetic and friendly peoplemark is always a joy to talk to mark and his dallas cowboy superfan bartender  are two of the most genuine people we ended up here by mistake-- best mistake weve ever made the drinks fantastic great drinks for a great price great environment they should keep the music going even if someone does play their own tho just go so', 'https://s3-media1.fl.yelpcdn.com/bphoto/ZnOr04rePOGOHXXF-I_EQQ/o.jpg', 'https://www.yelp.com/biz/bowhaus-tap-indianapolis-2', '$'),
('39.7649501000', '-86.1591087531', 'bowling', 1604, '120 South Meridian St', '+13172498613', 'Punch Bowl Social Indianapolis', '4.0', 780, 'Yyn4z5ZysBDYCXfTFzflaQ', ' came here with coworkers  its a huge place great food  great menu  the carnitas tacos were delicious  i also had chips and cheese sauce the nacho ive been to the carmel location once and this indy location once both times i have had a great experience the atmosphere of this place is bold and like how fun is this place   we decided to go here with a group of friends  there were 14 of us and it was easy to accommodate us  our waitress was awesome', 'https://s3-media2.fl.yelpcdn.com/bphoto/NoVjg3y_l2xwURdWxonvog/o.jpg', 'https://www.yelp.com/biz/punch-bowl-social-indianapolis-indianapolis-4', '$$'),
('39.7334801671', '-86.1686190000', 'musicvenues', 1605, '2352 S West St', '+13176436403', 'Dukes Indy', '4.5', 70, 'sbcsdlzTXEukhesCHM2fzg', ' great atmosphere friendly staff and amazing food their menu is limited to allow for quick service and almost every item can be vegetarianvegan-ized this place never disappoints the staff is so cool and friendly i stopped in yesterday after having a really bad day they played the role of therapist and thank you so much for the great service and care put into ensuring your patrons and artists have a great time ive been a regular since dustin opened the', 'https://s3-media3.fl.yelpcdn.com/bphoto/jn5Y2ufCewAdQ98ruYlTVw/o.jpg', 'https://www.yelp.com/biz/dukes-indy-indianapolis-2', '$$'),
