('39.7799615919', '-86.1438117877', 'food_court', 1654, '906 Carrollton Ave', '+13175561252', 'The Garage Food Hall', '4.5', 256, 'XWqyoKSVyg4H8zqA8kmRBg', ' one of my new favorite places to grab food with a group of people with diff tastes i had the harbor and ordered catfish basket with ginger ale the great panadas made piping hot gluten free deep-fried empanada that was classic delicious and good quality goodand then kicked up to whole new level by the the first time i attended the garage was on a cold snowy night driving up it was so cute how the area is decorated with lights and had so much charm', 'https://s3-media1.fl.yelpcdn.com/bphoto/y_eaQd1l5pPGvSBYZ0tSAw/o.jpg', 'https://www.yelp.com/biz/the-garage-food-hall-indianapolis-2', '$$'),
