('39.6979000000', '-86.0818000000', 'burgers', 1667, '5115 Shear Ave', '+13175919277', 'Culvers', '4.0', 15, 'fzdl0UsQh90NPw5_MMYqoQ', ' for fast food its one of the best burgers around also enjoy the cheese curds and their ice cream sundaes are very good too i would recommend this place food was delightful service was excellent from entry to exit overall a great place to eat and relaxing environment the lady that took our order went blazing fast service  young yet well organized staff they even have energy and personality as long as my cheddar double butter burgers w bacon are', 'https://s3-media3.fl.yelpcdn.com/bphoto/PYWy0Jsw_wgtgSFRF8C1CQ/o.jpg', 'https://www.yelp.com/biz/culvers-indianapolis-11', ''),
