('39.6360080000', '-86.1576210000', 'desserts', 1670, '8923 S Meridian St', '+13178849335', 'Prodigy Burger Bar', '2.5', 73, '51pgAUQ6aIdZEfSXiG39VQ', ' service was horrendously slow they were a little short staffed but not busy bathrooms very gross and dirtyfood was just ok i may consider going great burgers and service for friday night dinner definitely would recommend checking them out yes i went to a burger place and had mac  cheese haha it just sounded really good and prodigy burger bar has several different mac  cheese dishes i', 'https://s3-media2.fl.yelpcdn.com/bphoto/5QlxEOIRzuVY4EhSLC1Bvg/o.jpg', 'https://www.yelp.com/biz/prodigy-burger-bar-indianapolis-4', ''),
('39.7382584411', '-86.1202706000', 'bbq', 1674, '2412 E Raymond St', '+13174193515', 'Pull Up Grill & BBQ', '4.5', 94, 'u_zi5xTRslWrrLPTlTB61A', ' did not expect to be hit with the most delicious smells of home cooked food pulled pork brisket  catfish  perch fresh greens green beans  mac n i really wanted to give this place 5 stars if service only then it would be i order small rib tips with two sides mac and cheese and greens  the greens small bbq restaurant with big flavor this place has been on my list for awhile now so when we saw it pop up for be our guest on fox59 so we knew we had to', 'https://s3-media2.fl.yelpcdn.com/bphoto/9FLEv_IyoIrlN29jdCsYjA/o.jpg', 'https://www.yelp.com/biz/pull-up-grill-and-bbq-indianapolis', '$$'),
('39.7213940000', '-86.0889510000', 'newamerican', 1675, '607 Main St', '+13177890059', 'Backstop Diner', '2.5', 3, 'SrnSwM-ADm2nYkstk0o4Xg', ' this is such a cute place to eat went there a lot when i lived in the area def recommend i had a simple 10 inch pepperoni pizza and it was good  the prices are reasonable and the atmosphere was good  just as my buddy and i finished up i seen a food is poor quality and dining room is unsanitary i will never eat here again', 'https://s3-media4.fl.yelpcdn.com/bphoto/fcMh-s8ZaMRNf43WEQVbuQ/o.jpg', 'https://www.yelp.com/biz/backstop-diner-beech-grove', ''),
