('39.6532700000', '-86.1386677000', 'burgers', 1679, '7833 US 31', '+13177810855', 'Jaggers', '4.0', 142, 'uHGbpIMDNK_Sm8kui7uZOw', ' we come here once every weekend because of their great service and great food never a bad experience very clean location and really really nice staff i i have never been to a jaggers before  it wasnt what i expected  however it ended up being perfect for what we needed out of this dinning went to jaggers after a late night shopping in greenwood  the atmosphere was amazing everyone was very nice and friendly  the menu was very affordable ', 'https://s3-media1.fl.yelpcdn.com/bphoto/2XFmNGqhYFPseAwmnGlBjg/o.jpg', 'https://www.yelp.com/biz/jaggers-indianapolis', '$'),
('39.6370541934', '-86.0792428178', 'burgers', 1680, '5235 Noggle Way', '+13178519985', 'Freddys Frozen Custard & Steakburgers', '4.0', 100, 'rO8NE085Kt_2_QkWtw6S7g', ' good service  very good attentiveness by staff food came out fresh and fast manager even came by table and took left over tray freddys is a good fast ahh freddys  how i missed you too bad you are not located in southern california and always jump at the chance to visit you when i visit the midwest i have a feeling that if roger ebert were still alive hed likely be a fan of freddys frozen custard  steakburgers ebert was a longtime fan of the steak', 'https://s3-media2.fl.yelpcdn.com/bphoto/lt_P4ZgwTqBeakF_TTxa2g/o.jpg', 'https://www.yelp.com/biz/freddys-frozen-custard-and-steakburgers-indianapolis', '$'),
('39.7710892233', '-86.1545632411', 'burgers', 1685, '167 New York St', '+14632156170', 'Shake Shack', '3.5', 55, 'qvGoBKNSoW6PW1eE0C3t6A', ' this shake shack location is a great spot for an enjoyable lunch or dinner there is metered street parking right out front which is free on sundays i rarely go downtown indy but when i do i like to try new places to eat at today i went to shake shack because i was in the mood for a burger and it was it was my first time here and i ordered just a shake i got the black and white shake it was ok the kiosk was kind of cool it was really clean on the', 'https://s3-media1.fl.yelpcdn.com/bphoto/X73jgdvSBBFwhKHzAW_TBg/o.jpg', 'https://www.yelp.com/biz/shake-shack-indianapolis-2', '$$'),
('39.7707297519', '-86.0755590000', 'hotdog', 1690, '5402 E Washington St', '+13173592333', 'Chicago Beef And Dog Company', '4.5', 142, 'djL0Hmm9-CG5lsM8Ty_Myw', ' the food is absolutely amazing and the service feels like you are talking to your family 1010 recommend ive been to this place several times and im always happy happy enough that i forget to take pictures of my food before devouring it- every single time i finally was able to pop in and try this place i didnt know what to expect but i was definitely impressed the inside was nice and clean and even', 'https://s3-media3.fl.yelpcdn.com/bphoto/IvRxfmhbfHauFIl_qZkhlQ/o.jpg', 'https://www.yelp.com/biz/chicago-beef-and-dog-company-indianapolis-3', ''),
('39.7138820000', '-86.0817640000', 'burgers', 1694, '3625 S Emerson Ave', '+13177841552', 'Wendys', '1.0', 1, 'kw5GNWIcQBCXe-Sn2DN1ZQ', ' they are sometimes rude and will always mess up a order be sure to check if you go had a crushed up lid in one my drinks here also definitely dont recommend', '', 'https://www.yelp.com/biz/wendys-beech-grove', '$'),
('39.7525720000', '-86.1394762000', 'sandwiches', 1695, '1110 Prospect St', '+13174263048', 'Turchettis Delicatessen', '4.5', 145, '9XyO6Vk13vUXgJ2yM39P3A', ' love everything about turchettis  i was first introduced to them by a friend looking for some great charcuterie meats but fell in love with everything in our family popped into two cherries for lunch on a friday afternoon having never been there before we entered through the door to the left and werent this is much more than a butcher shop i just found out they have food and a bar and im so sad i didnt know about it sooner they have a restaurant on', 'https://s3-media2.fl.yelpcdn.com/bphoto/3e-pccDdbElyKFpQwfK2ew/o.jpg', 'https://www.yelp.com/biz/turchettis-delicatessen-indianapolis', '$$'),
('39.7817950000', '-86.0824100000', 'tradamerican', 1696, '5130 E 10th St', '+13173560996', 'Indys Historic Steer-In Restaurant', '4.0', 466, 'Gl2wxwEVFEc9Kb9TXIXQ5A', ' with a deep appreciation for rebellion against societal norms i found my visit to the steer inn restaurant on east 10th street in indianapolis to be both i heard about this restaurant years ago on diners drive-ins and dives but just made it in today it has that old school diner feel which i enjoyed the the quintessential diner drive-in and dive place the drive-in is still attached to the building but i dont think its useable other than for parking now', 'https://s3-media3.fl.yelpcdn.com/bphoto/Z9bn2TOGeKo06E7KYEtAtw/o.jpg', 'https://www.yelp.com/biz/indys-historic-steer-in-restaurant-indianapolis-2', '$$'),
('39.7726500000', '-86.1557900000', 'fooddeliveryservices', 1697, 'Indianapolis, IN 46204', '+18883953942', 'Guy Fieris Flavortown Kitchen', '3.0', 14, '6PJt5TQWp3qQW5UOkDPwjA', ' i didnt expect much from this place but let me tell you i had the rand burger and it was delicious the meat was thick and not thin got full off of the me and my co-workers ordered guy fieris flavortown kitchen for lunch  none of us have had it before  it is a delivery only restaurant i do believe so glad were able to get to flavortown here in indianapolisfood was excellent  will definitely order from the flavortown kitchen again and again', 'https://s3-media4.fl.yelpcdn.com/bphoto/Fw9sinsZGdO7LvPPj0Rtaw/o.jpg', 'https://www.yelp.com/biz/guy-fieris-flavortown-kitchen-indianapolis', ''),
('39.7680890000', '-86.0709530000', 'coffee', 1698, '120 S Audubon Rd', '+13172072127', 'Landlocked Baking Co.', '4.5', 93, 'r8FQd_kBkmQHIDAOKvoXiQ', ' based solely on a lovely photo i saw on landlocked bakings facebook page i ordered their vegan chai cake with maple buttercream frosting im not vegan good first time experience i didnt realize there was a full breakfast menu met a client for coffee and we both enjoyed our experience i got the ginger the landlocked baking co is a delightful bakerycoffee shop restaurant tucked away in irvington when i walked in i noticed there was an option to order at', 'https://s3-media1.fl.yelpcdn.com/bphoto/SH_ycP46eOfjLBNglBkf_w/o.jpg', 'https://www.yelp.com/biz/landlocked-baking-co-indianapolis', '$$'),
('39.7740449000', '-86.1498585000', 'delis', 1700, '410 E Michigan St', '+13176003008', 'Fat Dans Deli', '4.0', 243, '9xPOQKtIDVaI_fN3ns35LA', ' my girlfriend and i stopped in here for the first time sunday after churchthe name gave us an indication of the type of food we could expect and we im not sure how i havent been here before because i have been missing out located on college so parking can be tough but i promise its worth it inside i eat at the broad ripple location regularly and recommended to my coworkers to do lunch at the downtown locationive had the beef the combo the wings', 'https://s3-media4.fl.yelpcdn.com/bphoto/IuuO0OGMyOC3u53TRtW6ig/o.jpg', 'https://www.yelp.com/biz/fat-dans-deli-indianapolis-5', '$$'),
('39.6655800000', '-86.0473300000', 'newamerican', 1702, '6835 E Southport Rd', '+13172154109', 'Flashbacks', '3.5', 84, 'xYBjd852nB0-hEkebV7ytA', ' this fantastic restaurant and bar is practically in my neighborhood we got there around 530 and it was absolutely packed we got the last table in the im having a hard time not giving 5 stars for our visit your normal neighborhood bar where everyone knows everyone the menu was extensive with plenty of we love this place why not a five star is only because the kitchen never reads the tickets to minus or add things to the order this truly is a great spot', 'https://s3-media3.fl.yelpcdn.com/bphoto/6JBtptfxCHacVfrHGSu2pw/o.jpg', 'https://www.yelp.com/biz/flashbacks-indianapolis', '$$');
INSERT INTO `pois` (`Lat`, `Lng`, `Category`, `id`, `address`, `phone`, `name`, `rating`, `num_ratings`, `API_ID`, `reviews`, `image_url`, `url`, `price`) VALUES
('39.7591554085', '-86.0689051386', 'breakfast_brunch', 1703, '5730 Brookville Rd', '+13173572233', 'Rock-Cola 50s Cafe', '4.0', 168, 'OFip8f8cVjVPxhIYy46BDQ', ' just finished the biggest best breakfast weve ever had in the indianapolis area kitschy atmosphere awesome friendly service and the food lets just my mans always likes to go to these little places ive never heard of that are seemingly in the weirdest location possible i was expecting yet another vintage not only in decor but also in hospitality rock-cola gives the neighborhood a nice to see you again vibe great spot to enjoy one of the better', 'https://s3-media2.fl.yelpcdn.com/bphoto/NqNmokdGxJEfpGBlgLf92w/o.jpg', 'https://www.yelp.com/biz/rock-cola-50s-cafe-indianapolis', '$'),
('39.7851803098', '-86.1018551175', 'breakfast_brunch', 1705, '1313 N Sherman Dr', '+13176026379', '1313 Eatery', '4.5', 13, 'FyqT4eKaeYC33nxZV1nBXg', ' i came in for an early lunch great service the grippo wings are unique and amazing first off their wings are huge the wings are crispy with that a true hole-in-the wall but the service and the food is top notchi ordered the grippo wings they are made with grippo wing potato chips so they have the grippo chicken wings are a unique blend of spice and crunch that will keep you coming back for more  this eatery offers an abundance of menu items', 'https://s3-media3.fl.yelpcdn.com/bphoto/-UDYyTVVR5Crmh0oE-ejIQ/o.jpg', 'https://www.yelp.com/biz/1313-eatery-indianapolis', ''),
('39.7648400000', '-86.1602700000', 'brewpubs', 1706, '140 S Illinois St', '+13179867103', 'Goodwood Indy', '3.5', 143, 'TLpuvhkMKx8MGTE7W3Z-Lw', ' super friendly staff best hefeweizen beer weve had in indy sorry bier brewery and great tots - we got the truffle and beer cheese options both were large space combination of brewery distillery and restaurant headquartered in louisville beer flight was enjoyable this is brewery first and foremost hmmm im always curious when a place have reviews that are all over the board  makes me think the service is inconsistent but whateves im reviewing on', 'https://s3-media1.fl.yelpcdn.com/bphoto/HODbE2BhfIqwKFhte6GqXA/o.jpg', 'https://www.yelp.com/biz/goodwood-indy-indianapolis', '$$'),
('39.7304300000', '-86.1586400000', 'bars', 1707, '2535 S Meridian St', '+13173841027', 'Barringers Tavern', '4.0', 60, 'krcU3vu-4xC_O5Zb0IXqJg', ' came here during thanksgiving dinner we were glad that they were open and even had karaoke going onwe discovered this place during take-out only during ive been here a few times now for lunch standard tavernbar food order the wings or tenderloin or pizza i got the saddest steak sandwich last time so i we set out looking for a local spot that has great food that we would be able to spend the evening at and were so happy to have found that in barringers', 'https://s3-media2.fl.yelpcdn.com/bphoto/hKkFTmlpWQ4LoCzmK_mnbg/o.jpg', 'https://www.yelp.com/biz/barringers-tavern-indianapolis-2', ''),
('39.7185200000', '-86.1392000000', 'diners', 1708, '3301 Shelby St', '+13177843752', 'Jimmys Diner', '4.5', 74, 'gFVjC9nv8myy7PSWqnfmIQ', ' this is a small mom and pop dinner located off the beaten path just down the street from uindy it was fun how i found this place i was just driving down this little gem was a great find tucked away near the uindy campus this diner has a great homey feel and great food it is nice to know that our son has a cute little diner just south of downtown i was sat pretty quickly and was checked on throughout my breakfast great omelette with hash browns definitely', 'https://s3-media2.fl.yelpcdn.com/bphoto/c-tBx6EQzxJmKU7ZGDYfYA/o.jpg', 'https://www.yelp.com/biz/jimmys-diner-indianapolis-2', '$'),
('39.7526020000', '-86.1408570000', 'comfortfood', 1711, '1043 Virginia Ave', '+14632240430', 'Easy Rider Diner', '4.5', 83, 'fM-KhQo9az2EPRzkeVh13Q', ' easy rider is attached to the hi-fi concert venue and brings all day elevated diner food to fountain squarewe visited on a friday while a concert was this park is located in the heart of fountain square there is free street parking within a reasonable walking distance from this place but it is a bit ok this may be my new favorite brunch placethe inside is such a fun vibethe decor is definitely worth looking around for the service was fantastic', 'https://s3-media3.fl.yelpcdn.com/bphoto/U_GkPizI59QZ9ur7pC12vQ/o.jpg', 'https://www.yelp.com/biz/easy-rider-diner-indianapolis', '$$'),
