('39.7749162356', '-86.1457541448', 'breweries', 2173, '540 N College Ave', '+13176025670', 'St. Joseph Brewery & Public House', '4.0', 588, 'Yw-guSo-TKY3YbRrq0PELQ', ' we went to st josephs on sunday night and were able to get right in actually it was pretty empty we both got a beer and ordered some dinneri got the we made reservations for a large group here for a company christmas party  the plan was to head here after our candles curated from penn  beech place had tons of seats but told wait was 45 minutes not worth it we can find a brewery that doesnt turn customers away', 'https://s3-media2.fl.yelpcdn.com/bphoto/yO6FmT4gEHRUV18D7bIQlQ/o.jpg', 'https://www.yelp.com/biz/st-joseph-brewery-and-public-house-indianapolis-2', '$$'),
('39.7729278000', '-85.9946640000', 'shoes', 2177, '9727 E Washington Street', '+13178984220', 'Foot Locker', '4.5', 2, '6A3U_RhFGGoUQ3cDlszb4g', ' the tween had air jordan flight 3s on her must have list and i ordered what i thought she wanted online as i opened the box to wrap them i realized the concords dropping on 128 are you guys going to be selling or orders can only be made online     ', 'https://s3-media2.fl.yelpcdn.com/bphoto/xxhFl5U3KBHr4yx4iVoYyQ/o.jpg', 'https://www.yelp.com/biz/foot-locker-indianapolis-7', '$$$'),
