('39.7660170000', '-86.1674605000', 'sportsbars', 2191, '10 South West St', '+13178606500', 'High Velocity', '3.5', 309, 'T_HJvjWYGBtZWmRPzNJeBw', ' ive been coming to this place about 4 or 5 years now with 4 of my friends for the circle city classic hbc football games and we stay at jw marriot which high velocity is the marriot sports bar and it definitely has a sports bar vibe i found the menu and cocktails to be pretty overpriced - drinks were not john helped us the best server so attentive knowledgeable and fun i ordered the blood orange margarita delicious that wagyu burger is soooo good i', 'https://s3-media2.fl.yelpcdn.com/bphoto/OpoIZW7eu27-VSMeB1U6fA/o.jpg', 'https://www.yelp.com/biz/high-velocity-indianapolis', '$$'),
