('39.7668077622', '-86.1682613000', 'tradamerican', 2201, '501 W Washington St', '', 'TGI Fridays', '2.0', 175, 'l0YyLVlPt2zI7srCUu2oFQ', ' it was right next door to the hotel i was staying at so it was definitely convenient to eat here pretty decent sized with bar seating high tops counter does anyone still show up to eat microwaved meal bags anymore  they serve alcohol which is necessary to kill all the bacteria that is going to thrive in i frequent this location for quick casual meals and unique drinks my go-to meal option is the sizzling chicken and cheese and it seldom disappoints', 'https://s3-media1.fl.yelpcdn.com/bphoto/dUICkHEKB_pDR5ZzO0KRTQ/o.jpg', 'https://www.yelp.com/biz/tgi-fridays-indianapolis-6', '$$'),
